import { select } from 'd3';

export const Marks = ({ bins, sizeValue, projection }) => (
    <g className="marks">
        {bins.map((bin, i) => {
            const size = sizeValue(bin) || 0; // Add logic to calculate size if necessary
            const [x, y] = bin.x; // Get the center of the bin

            return (
                <path
                    key={i}
                    d={hexbin.hexagon(10)} // Hexagon radius
                    transform={`translate(${x}, ${y})`} // Position the hexagon
                    fill="orange" // Adjust color as needed
                    stroke="black"
                    strokeWidth={1}
                />
            );
        })}
    </g>
);
